import { UserNav } from "../../../component/Navbar/homeNav"
import { getPrinters } from "../../../data/data";
import '../Myprinters.css'
import { useNavigate } from "react-router-dom";
import { useEffect} from "react";
import { useState } from "react";

export default function Modify(){

    const [NamePrinter,SetNamePrinter] = useState("");
    const [Nozzles,SetNozzles] = useState(0);
    const [Soluble,SetSoluble] = useState(true);
    const [printer,SetPrinter] = useState();

    async function DataChange(){
        console.log(NamePrinter)
        console.log(Nozzles)
        console.log(Soluble)
    }

    async function onClick(){
        SetSoluble(!Soluble)
    }


    return(
        <div>
            <UserNav/>
            <div className="printerTable">
            <h1>Modify Printer</h1>
            <table className="myPrinters">
                
                    <tbody>
                    <tr>
                        <th>Name</th>
                        <th>NozzlesMounted</th>
                        <th>Soluble</th>
                    </tr> 

                    <tr>
                        <th><input type="text" placeholder="Name" onChange={(event)=> SetNamePrinter(event.target.value)}/></th>
                        <th><input type="number" placeholder="nozzles"onChange={(event)=> SetNozzles(event.target.value)}/></th>
                        <th><button className="printerButton" value={Soluble} onChange={e => SetSoluble(e.target.value)} onClick={onClick}>{Soluble.toString()}</button></th>
                    </tr>

                   </tbody>
                   <button className="printerButton" onClick={DataChange}>Modify</button>
                </table>
                </div>
        </div>
    )
}
